          <p>
            Фонд «301. Земля мудрости» — некоммерческая организация и
            осуществляет свою деятельность с помощью взносов участников клуба
            «301». Размер взноса составляет 301$ в месяц. Участником клуба может
            стать каждый, кто разделяет нашу миссию и ценности вне зависимости
            от географических границ.
          </p>
